from PIL import Image, ImageDraw
import StringIO
import random
import base64
import sys

class Generator:
    """
    Generate images
    """
    def __init__(self, image_size):
        self.image_size = image_size
        self.param_ranges = {
            "n_shapes": [4,36],
            "w_base": [4,46], 
            "w_range": [4,26],
            "h_base": [4,46],
            "h_range": [4,26],
            "r_base": [0,255],
            "g_base": [0,255],
            "b_base": [0,255],
            "c_range": [80,120]
        }
        #self.test_img = ""
        #self.test_img = ''
        self.test_img = ''
    def create_image(self, params):
        image = Image.new("RGB", (self.image_size, self.image_size), 'black')
        draw = ImageDraw.Draw(image)
        
        ns=0
        #for i in range(0, params["n_shapes"]):
        while (ns<params["n_shapes"]):
            x = random.randint(0,self.image_size-20)
            y = random.randint(0,self.image_size-20)
            w = self.rand_int_range(params["w_base"], params["w_range"])
            h = self.rand_int_range(params["h_base"], params["h_range"])
            r = self.rand_int_range(params["r_base"], params["c_range"])
            g = self.rand_int_range(params["g_base"], params["c_range"])
            b = self.rand_int_range(params["b_base"], params["c_range"])
            if (w<3 or h<3):
                continue
            if (r<20 and g<20 and b<20): 
                continue
            draw.ellipse((x, y, x+w, y+h), fill=(r, g, b))
            ns+=1
            
        del draw 
        return image
    
    def denormalize_params(self, params):
        dparams = {}
        for k,v in params.items():
            nv = int(v * self.param_ranges[k][1] + self.param_ranges[k][0])
            #sys.stderr.write(k + ' ' + str(v) + ' ' + str(nv) + "\n")
            dparams[k] = nv
        return dparams
    
    def rand_int_range(self, b, r):
        if r<4: r=4
        return random.randint(b-(r/2),b+(r/2))
    
    def to_data_url(self, image):
        output = StringIO.StringIO()
        format = 'PNG' 
        image.save(output, format)
        contents = output.getvalue()
        output.close()
        encoded_string = base64.b64encode(contents)
        encoded_string = self.test_img
        data_url = 'data:image/png;base64,' + encoded_string
        return data_url    
    
    def generate_one(self, params):
        dparams = self.denormalize_params(params)
        image = self.create_image(dparams)
        url = self.to_data_url(image)
        return url
 